import React from 'react';
import { ListGroup, ListGroupItem, Button } from 'react-bootstrap';

const EmployeeLinks = () => {
    return (
        <div className="employeeList">
            <ListGroup>
                <ListGroupItem><Button variant="outline-primary">Department</Button></ListGroupItem>
                <ListGroupItem><a href="#">Sort</a></ListGroupItem>
                <ListGroupItem><a href="#">Search</a></ListGroupItem>
                <ListGroupItem><a href="#">Add</a></ListGroupItem>
                <ListGroupItem><a href="#">Remove</a></ListGroupItem>
            </ListGroup>
        </div>
    )
}

export default EmployeeLinks
